import React from 'react';


const Practice = (props) => {
  const { id, question, solutionA, solutionB, solutionC, solutionD, answer, explanations } = props.card;
  return (
      <div key={id} className="card">
          <span className="question-practice">{question}</span>
      </div>
  );
};


export default Practice;
